    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( + 79 * + + col0 / - + 50 + - + col2 + col0 * + ( col1 ) ) NOT BETWEEN - col1 AND NULL;
  - name: tab2

outputs:
  - name: q1650.out
    data: |
